import React from 'react';
import './App.css';


function App() {
    return (
        <div>
            <header>
                <img src='https://i.pinimg.com/736x/0d/cf/b5/0dcfb548989afdf22afff75e2a46a508.jpg'/>
            </header>
            <nav>
                <div>Profile</div>
                <div>Message</div>
            </nav>
        </div>
    );
}

export default App;
